import React from 'react';

function AboutUs() {
  return (
    <div className="aboutUs">
      <h2>О нас</h2>
      <p>
        Мы - команда Anakot, занимающаяся разработкой инновационных решений для заботы о питомцах.<br/>
        Наша цель - улучшить жизнь ваших питомцев и помочь вам сделать их счастливыми и здоровыми!
      </p>
    </div>
  );
}

export default AboutUs;
